import React, { Component } from 'react';

//make the query
import gpl from 'graphql-tag';
import {Query} from 'react-apollo';

const DOWNLOADS_QUERY = gpl`
  query DownloadsQuery {
    downloads
    {
        app_id
        longitude
        latitude
    }
  }
`;

export class downloads extends Component {
    render() {
        return (
            <div>
                <h1>Test</h1>
            </div>
        )
    }
}

export default downloads
